import React from 'react'
import ProfileTaskContainer from './ProgressTaskContainer.js'


class ProfilePage extends React.Component {

    render() {

        return (
            <>
            <h1>Lending a Hand</h1>
            <ProgressTaskContainer tasks = {this.props.tasks} currentUser ={this.props.currentUser}/>
            <h1>Asking for Help</h1>
            </>

        )
    }

}

export default ProfilePage;
